import { NavLink } from 'react-router-dom';
import {_Navbar} from '..//stl-cmp'

const Navbar = ()=>{
    return (
        <_Navbar>
            <div className="logo">
            <p className="logo">can</p>
            </div>
            <div className="links">
            <NavLink to={'/app/about'}>{'About'}</NavLink>
            <NavLink to={'/app/'}>{'Home'}</NavLink>
            </div>
        </_Navbar>
    )
}

export default Navbar;
